import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { getItems } from '../services/api';
import './ItemsList.css';

function ItemsList() {
  const [items, setItems] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    loadItems();
  }, []);

  const loadItems = async () => {
    try {
      setLoading(true);
      const data = await getItems();
      setItems(data);
    } catch (error) {
      console.error('Error loading items:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleProductClick = (productId) => {
    navigate(`/product/${productId}`);
  };

  // Get first 3 products for the home page
  const featuredProducts = items.slice(0, 3);

  if (loading) {
    return (
      <div className="items-container loading-container">
        <div className="spinner"></div>
        <p>Loading products...</p>
      </div>
    );
  }

  return (
    <div className="items-container">
      <div className="hero-section">
        <div className="hero-content">
          <span className="subtitle">Music is Classic</span>
          <h1 className="title">Sequoia Inspiring Musico.</h1>
          <div className="feature">
            <span className="feature-number">01</span>
            <div className="feature-content">
              <h3>Clear Sounds</h3>
              <p>Making your dream music come true stay with Sequoia Sounds!</p>
            </div>
          </div>
          <button 
            className="view-all-btn"
            onClick={() => navigate('/products')}
          >
            View All Products
          </button>
        </div>
        <div className="hero-image">
          <img src="/images/headphone.png" alt="Blue Headphones" className="main-product-image" />
        </div>
      </div>

      <div className="products-grid">
        {featuredProducts.map((product, index) => (
          <div 
            key={product.id}
            className={`product-card ${index === 0 ? 'featured' : ''}`}
            onClick={() => handleProductClick(product.id)}
          >
            <h3>{product.category}</h3>
            <h2>{product.name}</h2>
            <p>{product.description}</p>
            <img 
              src={product.image_urls} 
              alt={product.name} 
              className="product-image"
            />
            <button className="view-more">â†’</button>
          </div>
        ))}
      </div>

      <div className="social-links">
        <p>Follow us on:</p>
        <div className="social-icons">
          <a href="#twitter"><i className="fab fa-twitter"></i></a>
          <a href="#tiktok"><i className="fab fa-tiktok"></i></a>
          <a href="#instagram"><i className="fab fa-instagram"></i></a>
          <a href="#linkedin"><i className="fab fa-linkedin"></i></a>
        </div>
      </div>
    </div>
  );
}

export default ItemsList;
